import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for cart element and click to open
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal.png'));

    // Check if cart has items and remove first item
    const cartItems = await page.$$('.cart-item');
    if (cartItems.length === 0) {
      throw new Error('Cart is empty, cannot remove item');
    }

    // Get initial cart count
    const initialCount = await page.textContent('#cartCount');

    // Click remove button on first cart item
    await page.click('.remove-item:first-of-type');

    // Wait for cart to update
    await page.waitForFunction(
      (expectedCount) => {
        const countElement = document.getElementById('cartCount');
        return countElement && parseInt(countElement.textContent) < parseInt(expectedCount);
      },
      initialCount,
      { timeout: 5000 }
    );

    // Take screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_removal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_removal.png'));

    // Get updated cart count
    const updatedCount = await page.textContent('#cartCount');

    return {
      success: true,
      action: "Removed item from cart",
      extractedData: {
        initialCartCount: parseInt(initialCount),
        updatedCartCount: parseInt(updatedCount)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
